import React from 'react'
import { Flex, Box, Text, useBreakpoint } from 'quantum-elements'
import Container from './container'
import NavLink from './navlink'

function Navbar() {
  const breakpoint = useBreakpoint()

  return (
    <Container h={80} px={3} mb={3} align="center" justify="space-between">
      <NavLink to="/">
        <img src="https://avatars0.githubusercontent.com/u/28285686?s=400&u=891673c9b13f71437d0ecb14a69dbb4ef4ee7688&v=4" style={{ width: 32, marginRight: 2, borderRadius: '50%' }} />
        <Text weight={500} size={18}>
          Michael Auderer
        </Text>
      </NavLink>
    </Container>
  )
}

export default React.memo(Navbar)
